import React, { useContext } from 'react'
import HeaderOfPage from '../components/DetailPageComponents/header/HeaderOfPage'
import '../styles/DetailPage/header.css'
import {Context} from '../context/detailHandler'


const ProductsDetail = () => {
    console.log(useContext(Context))
    const { sum, count } = useContext(Context)
    return (
        <Context.Consumer>
            <div className="container">
                <HeaderOfPage count={count} sum={sum} />
            </div>
        </Context.Consumer>
    )
}

export default ProductsDetail;
